import { useHistory } from "react-router-dom";

export function checkuser() {
  const history = useHistory();
  const user = JSON.parse(localStorage.getItem("users"));
  const token = localStorage.getItem("jwtauth");
  if (!token) {
    history.push("/login");
  }
}
